import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Choose from './Container/About/Choose/Choose';
import Profile from './Container/About/Profile/Profile';
import About from './Container/About/Aboutus/About';
import './App.css';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';

import { NavLink } from 'react-router-dom';
import Home from './Container/Home/home'

class App extends Component {
  state={
    
  }
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false,
      fixed: true
    };
  }

  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div className="App">
      <Navbar color="light" light expand="md" sticky="top">
          <NavbarBrand href="/">CanVisaGuide</NavbarBrand>

          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink to='/'><span className='links'>Home</span></NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>

                <DropdownToggle nav caret>
                  About Us   
                </DropdownToggle>
             
                <DropdownMenu right>
                  <DropdownItem>
                    <NavLink to='about'><span className='linksDrop'>About Us</span></NavLink>
                  </DropdownItem>
                  <DropdownItem>
                   <NavLink to ='choose'> <span className='linksDrop'>Why Choose us?</span></NavLink>
                  </DropdownItem>
                  <DropdownItem>
                  <NavLink to ='profile'> <span className='linksDrop'>Our Profile</span></NavLink>
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>

              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Why ICCRC Membership?
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Why ICCRC?
                  </DropdownItem>
                  <DropdownItem>
                   What is ICCRC?
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
      
      <Route path="/about" component={About}/>
      <Route path="/choose" exact component={Choose}/>
      <Route path="/profile" exact component={Profile}/>
      <Route path="/" exact component={Home}/>
      

      </div>
    );
  }
}

export default App;
